        setBusca(event.target.value)
        console.log(onChangeBusca)
        }

    const buscar= () => {
    const buscarItem = busca
    console.log(buscarItem)
    setBusca("")
     }

    const listaDeProdutos = produtos.map(
        (item)=>
        <CamisetaStyle>{item.id} {item.nome} {item.foto} {item.valor} {item.botao}  </CamisetaStyle>
    )

    return(

        <div>
         <InputBusca 
         busca = {busca}
         setBusca= {setBusca}>
        </InputBusca> 
        <ConteinerStyle>{listaDeProdutos}</ConteinerStyle>
        </div>
    )
}


export default HomePage
